import React from 'react';

const HomeSection = () => {
  return (
    <div style={{ width: '1440px', height: '100px', backgroundColor: '#f0f0f0', textAlign: 'center', paddingTop: '20px', position: 'relative' }}>
      <img
        src="https://example.com/your-image.jpg"  // Replace with the actual URL of your image
        alt="Description of the image"
        style={{ maxWidth: '100%', maxHeight: '100%', height: 'auto', width: 'auto', float: 'left' }}
      />
      <div style={{ width: '200px', height: '80px', backgroundColor: 'lightyellow', position: 'absolute', bottom: '0', right: '0' }}>
        {/* Content of the rectangle box */}
        <p>Additional Content</p>
      </div>
    </div>
  );
};

export default HomeSection;
